import React from 'react';
import Header from './Header';
import Description from './Description';
import Cycle from './Cycle';
import Nav from './Nav';
import { Container, Row, Col } from 'react-grid-system';
function Main() {
  return (
    <div style={{padding:"20px"}}>
      <Row style={{color:"red",background:"black",justifyContent:"center",padding:"20px"}}>
        <Header />               
      </Row>
      <Row>
          <Col sm={8} style={{background:"aqua",height:"715px"}}>
              <Cycle />
          </Col>
          <Col sm={4} style={{background:"blue",fontSize:"200%"}}>
              <Description />
          </Col>
      </Row> 
      <Row>
          <Col md={8} style={{background:"aqua",padding:"15px"}}>
             <Nav />
          </Col>   
          <Col md={4} style={{background:"blue"}}>
          </Col>             
      </Row>   
    </div>
  );
}

export default Main;
